import React, { Component } from "react";
import { HorizontalBar } from "react-chartjs-2";

export default function BarChart(props) {
  const list = [];

  for (var i = 0; i < props.YearData.length; i++) {
    var object = {
      year: " ",
      month: " ",
      satId: " ",
    };
    var date = props.YearData.above[i].launchDate;
    var dataObject = new Date(date);
    object.year = dataObject.getFullYear();
    object.month = dataObject.getMonth();
    object.satId = props.YearData.above[i].satid;
    list.push(object);

    // console.log(data.above[i].launchDate)
    // console.log(data.above[i].satid)
  }
  console.log(list);

  return <div className="BarChart"></div>;
}
